	add("plagiarism", "{\"term\":\"plagiarism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|plagiary|ism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of plagiarizing: the copying of another person\u0027s ideas, text or other creative work, and presenting it as one\u0027s own, \u0027especially\u0027 without permission\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Even if it\u0027s not illegal, \u0027\u0027plagiarism\u0027\u0027 is usually frowned upon\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Copy from one, it\u0027s \u0027\u0027plagiarism\u0027\u0027. Copy from two, it\u0027s research\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Text or other work resulting from this act\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The novel was awash in \u0027\u0027plagiarism\u0027\u0027, with entire passages lifted verbatim\", \"priority\":5}]}, \"synonyms\":{}}");

	add("plagiarist", "{\"term\":\"plagiarist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|plagiary|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who plagiarizes; or purloins the words, writings, or ideas of another, and passes them off as his or her own; a literary thief; a plagiary\", \"priority\":1}]}, \"synonyms\":{}}");

