	add("plantage", "{\"term\":\"plantage\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|plant|age|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Plants in general, or anything that is planted\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Shakespeare, \u0027Troilus and Cressida\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As true as steel, as \u0027\u0027plantage\u0027\u0027 to the moon\", \"priority\":3}]}, \"synonyms\":{}}");

	add("plantation", "{\"term\":\"plantation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027plantation\u0027 from Latin \u0027plantātiō\u0027 (planting, transplanting) from \u0027plantātus\u0027 (planted) the perfect passive participle of \u0027planto\u0027 + action noun suffix \u0027-tiō\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Large farm; estate or area of land designated for agricultural growth. Often includes housing for the owner and workers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/asia/21580154-forest-fires-bring-record-levels-air-pollution-and-end-not-sight-unspontaneous Unspontaneous passage\u003dSince the mid-1980s, when Indonesia first began to clear its bountiful forests on an industrial scale in favour of lucrative palm-oil \u0027\u0027plantations\u0027\u0027, “haze” has become an almost annual occurrence in South-East Asia. The cheapest way to clear logged woodland is to burn it, producing an acrid cloud of foul white smoke that, carried by the wind, can cover hundreds, or even thousands, of square miles\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Area where trees are planted for commercial purposes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The importation of large numbers of workers and soldiers to displace the local population, such as in medieval Ireland and in the Caribbean\", \"priority\":4}]}, \"synonyms\":{}}");

	add("planter", "{\"term\":\"planter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|plant|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A box or pot for plants, usually large and standing on the floor\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of the early English settlers, given the lands of the dispossessed Irish populace during the reign of Elizabeth I\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A machine used for planting seeds\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A person who plants seeds, either by hand or by machine\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The owner of a plantation\", \"priority\":5}]}, \"synonyms\":{}}");

	add("planting", "{\"term\":\"planting\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A plant (or clipping) that has been freshly planted\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Take one of the \u0027\u0027plantings\u0027\u0027 over as a house-warming gift\", \"priority\":2}]}, \"synonyms\":{}}");

	add("plasmid", "{\"term\":\"plasmid\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|plasma|id|lang\u003den}}, coined 1952 by American molecular biologist w:Joshua Lederberg|Joshua Lederberg.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A loop of double-stranded DNA that is separate from and replicates independently of the chromosomes, most commonly found in bacteria, but also in archaeans and eukaryotic cells, and used in genetic engineering as a vector for gene transfer\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Christopher Howe, \u0027Gene Cloning and Manipulation\u0027, [http://books.google.com.au/books?id\u003d2m6mVdZWvfUC\u0026amp;pg\u003dPA144\u0026amp;dq\u003d%22plasmid%22%7C%22plasmids%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d2Zt8U5PmJsKJlAXugYG4Ag\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22plasmid%22%7C%22plasmids%22\u0026amp;f\u003dfalse page 144\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"This is how the F (for \u0026quot;fertility\u0026quot;) \u0027\u0027plasmid\u0027\u0027, which forms the basis of a lot of classical \u0027E. coli\u0027 genetics, is transferred from one cell to another\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, \u0027Genome\u0027, Harper Perennial 2004, p. 247\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Bacteria are happy to absorb little rings of DNA called \u0027\u0027plasmids\u0027\u0027 and adopt them as their own\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Karl Friehs, \u0027\u0027\u0027Plasmid\u0027\u0027 Copy Number and \u0027\u0027Plasmid\u0027\u0027 Stability\u0027, M. Beyer, T. Scheper (editors), \u0027New Trends and Developments in Biochemical Engineering\u0027, Volume 86, [http://books.google.com.au/books?id\u003dbiHGhxcygj8C\u0026amp;pg\u003dPA47\u0026amp;dq\u003d%22plasmid%22%7C%22plasmids%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d2Zt8U5PmJsKJlAXugYG4Ag\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22plasmid%22%7C%22plasmids%22\u0026amp;f\u003dfalse page 47\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Plasmids\u0027\u0027 have an essential impact on productivity. Related factors are \u0027\u0027plasmid\u0027\u0027 copy number, structural \u0027\u0027plasmid\u0027\u0027 stability and segregational \u0027\u0027plasmid\u0027\u0027 stability\", \"priority\":9}]}, \"synonyms\":{}}");

	add("plasmodium", "{\"term\":\"plasmodium\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"Latin\"], \"text\":\"From German \u0027plasmodium\u0027 from Latin \u0027plasma\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mass of cytoplasm, containing many nuclei, created by the aggregation of amoeboid cells of slime molds during their vegetative phase\", \"priority\":1}]}, \"synonyms\":{}}");

	add("plasmogamy", "{\"term\":\"plasmogamy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|plasma|gamy|t2\u003dunion for propagation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Stage of sexual reproduction joining the cytoplasm of two parent mycelia without the fusion of nuclei\", \"priority\":1}]}, \"synonyms\":{}}");

	add("plasmon", "{\"term\":\"plasmon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|plasma|on|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"All the genetic material in an organism\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The quantum of waves produced by the collective effects of large numbers of electrons when disturbed from equilibrium\", \"priority\":2}]}, \"synonyms\":{}}");

	add("plaster", "{\"term\":\"plaster\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"Latin\", \"anglo-norman\"], \"text\":\"Old english (ca. 450-1100) \u0027plaster\u0027 from late Latin \u0027plastrum\u0027 shortened from Classical Latin \u0027emplastrum\u0027 (a plaster, bandage) later reinforced by Anglo-norman \u0027plaistre\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A paste applied to the skin for healing or cosmetic purposes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A small adhesive bandage to cover a minor wound; a sticking plaster\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A mixture of lime or gypsum, sand, and water, sometimes with the addition of fibres, that hardens to a smooth solid and is used for coating walls and ceilings\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A cast made of plaster of Paris and gauze; plaster cast\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"plaster of Paris\", \"priority\":5}]}, \"synonyms\":{}}");

	add("plasterer", "{\"term\":\"plasterer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|plaster|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person whose occupation is to plaster walls\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1593\u0027\u0027, w: William William Shakespeare, \u0027s: The Second Part of King Henry the Henry VI, Part 2\u0027, IV.ii. 125\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Villain, thy father was a \u0027\u0027plasterer\u0027\u0027; / And thou thyself a shearman, art thou not\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One who makes plaster casts\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Sir H. Wotto\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027plasterer\u0027\u0027 doth make his figures by addition, and the carver by substraction\", \"priority\":6}]}, \"synonyms\":{}}");

	add("plastic", "{\"term\":\"plastic\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027plasticus\u0027 (of molding) from Ancient greek (to 1453) \u0027πλαστικός\u0027 () from \u0027πλάσσειν|lang\u003dgrc\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sculptor, moulder\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any solid but malleable substance\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A synthetic, thermoplastic, solid, hydrocarbon-based polymer\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/science-and-technology/21581981-what-pollution-some-opportunity-others-welcome-plastisphere Welcome to the passage\u003d\u0027\u0027Plastics\u0027\u0027 are energy-rich substances, which is why many of them burn so readily. Any organism that could unlock and use that energy would do well in the Anthropocene. Terrestrial bacteria and fungi which can manage this trick are already familiar to experts in the field. Dr Mincer and Dr Amaral-Zettler found evidence of them on their marine \u0027\u0027plastic\u0027\u0027, too\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Any similar synthetic material, not necessarily thermoplastic\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"credit Credit or debit cards used in place of cash to buy goods and services\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dIt\u0027s all about fast cars and cussing each other / but it doesn\u0027t matter cause I\u0027m packing \u0027\u0027plastic\u0027\u0027 / and that\u0027s what makes my life so fucking fantastic\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Fakeness, or a person who is fake or arrogant, or believes that they are better than the rest of the population\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"author\u003d, year\u003d2004|passage\u003dCady: You know I couldn\u0027t invite you. I had to pretend to be \u0027\u0027plastic\u0027\u0027.\u0026lt;br\u0026gt;Janis: Hey, buddy, you\u0027re not pretending anymore. You\u0027re \u0027\u0027plastic\u0027\u0027. Cold, shiny, hard \u0027\u0027plastic\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"author\u003d| passage\u003dTessa: Pretty ironic that a box full of rubbers landed me to a town full of \u0027\u0027plastic\", \"priority\":10}]}, \"synonyms\":{}}");

	add("plasticizer", "{\"term\":\"plasticizer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various substances added to a material (such as plastic or concrete) in order to make it more pliable\", \"priority\":1}]}, \"synonyms\":{}}");

	add("platan", "{\"term\":\"platan\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"{{borrowing|la|platanus|lang\u003den}}; later reborrowed from Middle french (ca. 1400-1600) \u0027platane\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A planetree\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1633\u0027\u0027, John Donne, \u0026quot;The Autumnall\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Xerxes\u0027 strange \u0027Lydian\u0027 love, the \u0027\u0027\u0027Platane\u0027\u0027\u0027 tree, / Was lov\u0027d for age, none being so large as shee\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A double hill ran up his furrowy forks / Beyond the thick-leaved \u0027\u0027platans\u0027\u0027 of the vale.Category:en:Proteales order plants\", \"priority\":4}]}, \"synonyms\":{}}");

	add("platelayer", "{\"term\":\"platelayer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|plate|layer|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A railway employee who inspects and maintains the permanent way of a railway installation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("plateman", "{\"term\":\"plateman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|plate|man|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person in charge of the tableware (originally silver plate) in a restauran\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"someone who cleans plate\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"baseman\", \"priority\":3}]}, \"synonyms\":{}}");

	add("plater", "{\"term\":\"plater\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|plate|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who plates metal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Someone who installs sheet metal and armour plating, particularly on trains, ships, tanks, and similar items\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A machine for calendering paper\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A device for depositing cells on a plate\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A horse that runs chiefly in selling plates; hence, an inferior racehorse\", \"priority\":5}]}, \"synonyms\":{}}");

	add("platinate", "{\"term\":\"platinate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several oxyanions of platinum, or the salts containing these ions\", \"priority\":1}]}, \"synonyms\":{}}");

	add("platinumsmith", "{\"term\":\"platinumsmith\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|platinum|smith|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a worker in platinum, who makes platinum jewelry\", \"priority\":1}]}, \"synonyms\":{}}");

	add("platoon", "{\"term\":\"platoon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"middle french (ca. 1400-1600)\"], \"text\":\"From obsolete French \u0027plauton\u0027 variant of \u0027\u0027 from Middle french (ca. 1400-1600) \u0027pelote\u0027 + \u0027\u0027 Compare \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A unit of thirty to forty soldiers typically commanded by a lieutenant and forming part of a company\", \"priority\":1}]}, \"synonyms\":{}}");

	add("platygaeanism", "{\"term\":\"platygaeanism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|platygaean|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"belief that the Earth\u0027s shape is a plane or disk\", \"priority\":1}]}, \"synonyms\":{}}");

	add("platykurtosis", "{\"term\":\"platykurtosis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|platy|kurtosis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The property of having negative kurtosis\", \"priority\":1}]}, \"synonyms\":{}}");

	add("platypnea", "{\"term\":\"platypnea\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"shortness of Shortness of breath that occurs when the patient is upright. The word is derived from the Greek platus (\u003d flat) and pnoia (\u003dbreath\", \"priority\":1}]}, \"synonyms\":{}}");

	add("plaudit", "{\"term\":\"plaudit\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027lang\u003dla\u0027 second-person plural imperative of \u0027lang\u003dla|plaudere\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mark or expression of applause; praise bestowed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1862\u0027\u0027, Washington Irving, \u0027Works of Washington Irving\u0027, page 490\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The roof now rung with bravos, handkerchiefs were waved on every side, “three cheers,” again and again, and \u0027\u0027plaudit\u0027\u0027 upon \u0027\u0027plaudit\u0027\u0027 following in such quick succession, begun, ended, and begun again, that it was some time before the toast with which Mr. Irving concluded, could be heard\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, Edgar Rice Burroughs, \u0027The Gods of Mars\u0027, page 109\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"They were very orderly- there were neither scoffs nor \u0027\u0027plaudits\u0027\u0027, and when they saw us at the window above them there were many who buried their faces in their arms and wept\", \"priority\":5}]}, \"synonyms\":{}}");

	add("playability", "{\"term\":\"playability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|play|ability|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or property of being playable\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A measure of either the ease by which a video game may be played, or of the overall quality of its gamepla\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Mutant Chickens from Mars has great graphics, but the \u0027\u0027playability\u0027\u0027 is lacking\", \"priority\":3}]}, \"synonyms\":{}}");

	add("playboating", "{\"term\":\"playboating\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|play|boating|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of whitewater kayaking or canoeing where the paddler performs various technical moves in one place (a playspot), rather than travelling the length of a section of river\", \"priority\":1}]}, \"synonyms\":{}}");

	add("playdough", "{\"term\":\"playdough\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|play|dough|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"modeling Modeling clay for children\", \"priority\":1}]}, \"synonyms\":{}}");

	add("player", "{\"term\":\"player\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027playere\u0027 from Old english (ca. 450-1100) {{m|ang|pleġere||player, athlete, wrestler}}, equivalent to {{suffix|play|er|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One that play\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who plays any game or sport\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An actor in a dramatic play\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One who plays on a musical instrument\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A gamer; a gamester\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A gambler\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A mechanism that actuates a player piano or other automatic musical instrument\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An electronic device or software application that plays audio and/or video media, such as CD player\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"One who is playful; one without serious aims; an idler; a trifler\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A significant participant\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"He thought he could become a \u0027\u0027player\u0027\u0027, at least at the state level\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A person who play the plays the field rather than having a long-term sexual relationship\", \"priority\":12}]}, \"synonyms\":{}}");

	add("playette", "{\"term\":\"playette\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|play|ette|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A short play (dramatic work\", \"priority\":1}]}, \"synonyms\":{}}");

	add("playground", "{\"term\":\"playground\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Appendix:Glossar. compound|Compound of {{compound|play|ground|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large open space to play on, usually for children\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A yard or other open-air space on a school campus where the children can play, especially during break\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Small area with dedicated play equipment, usually for childre\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The city park \u0027\u0027playgrounds\u0027\u0027 offer various slides, tubes and swings\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Any physical or metaphysical space in which a person or organization has free rein to do as they please\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The exclusive tropical island was a millionaire\u0027s \u0027\u0027playground\", \"priority\":6}]}, \"synonyms\":{}}");

	add("playhouse", "{\"term\":\"playhouse\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|play|house|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A theater; a venue for performing plays\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A toy house for children to play in; a cubby house or Wendy house\", \"priority\":2}]}, \"synonyms\":{}}");

	add("playing", "{\"term\":\"playing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|play|ing|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An occasion on which something, such as a song or show, is played\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the Nielsen figures show that average viewership across all \u0027\u0027playings\u0027\u0027 fell by only 40 percent and that total viewership of the entire season’s episodes fell by only 20 percent\", \"priority\":2}]}, \"synonyms\":{}}");

	add("playlet", "{\"term\":\"playlet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|play|let|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A short play (dramatic work\", \"priority\":1}]}, \"synonyms\":{}}");

	add("playlist", "{\"term\":\"playlist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|play|list|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A list of recorded songs scheduled to be played on a radio station\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A list of tracks to be played in a particular sequence, as from an audio CD\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A handwritten list of songs, prepared mainly for a band, to be performed by the lead singer(s) during a concert; a set list\", \"priority\":3}]}, \"synonyms\":{}}");

	add("playlistism", "{\"term\":\"playlistism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|playlist|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The practice of judging other people based on the contents of their music playlist\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, w:Leander Leander Kahney, \u0026quot;[http://www.macworld.com/article/1047783/cult.html The Cult of iPod]\u0026quot;, \u0027Playlist\u0027, 2 November 2005\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This has lead to a new kind of music snobbery called \u0027\u0027\u0027playlistism\u0027\u0027\u0027. Music snobs amuse themselves by laughing at a colleague\u0027s collection of showtunes, or the hopelessly pretentious jazz of the goatee-ed guy at the other end of the dorm\", \"priority\":3}]}, \"synonyms\":{}}");

	add("playmate", "{\"term\":\"playmate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|play|mate|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A companion for someone (especially a child) to play with\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An indulgent \u0027\u0027playmate\u0027\u0027, Grannie would lay aside the long scratchy-looking letter she was writing (heavily crossed ‘to save notepaper’) and enter into the delightful pastime of ‘a chicken from Mr Whiteley\u0027s’\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A female who has appeared as the centerfold in Playboy magazine\", \"priority\":3}]}, \"synonyms\":{}}");

